import React, { useState } from 'react';
import SignInPage from './Login.js'

const SignUpPage = () => {
  const [Name, setName] = useState('');
  const [Number, setNumber] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [speciality, setspeciality] = useState('');

  const HandleNamed = (event) => {
    setName(event.target.value);
  };

  const HandleNumber = (event) => {
    setNumber(event.target.value);
  };

  const HandleEmail = (event) => {
    setEmail(event.target.value);
  };

  const HandlePassword = (event) => {
    setPassword(event.target.value);
  };

  const Handlespeciality = (event) => {
    setspeciality(event.target.value);
  };

  const HandleSubmit = (event) => {
    event.preventDefault();
    setEmail('');
    setPassword('');
  };
  <input type='text' className='Input' placeholder='Enter your speciality ' value={speciality}></input>
  return (
    <div className="assign">
      <u><h1 className='header'>Create New Account</h1></u>
      <form onSubmit={HandleSubmit}>
      <br></br>
      <div className="sign-body">
        
      </div>
        <label>
          <input className='Input' type="text" placeholder='Enter your name' id='SignUpName' value={Name} onChange={HandleNamed} />
        </label>
        <br />
        <label>
          <input className='Input' type="email" placeholder='Enter your e-mail' id='SignUpEmail' value={email} onChange={HandleEmail} />
        </label>
        <br />
        <label>
          <input className='Input' type="text" placeholder='Enter your phone number' id='SignUpNUMBER' value={Number} onChange={HandleNumber} />
        </label>
        <br />
        <label>
          <input className='Input' type="password" placeholder='Enter your password'id='SignUpPAss2' value={password} onChange={HandlePassword} />
        </label>
        <br />
        <label>
          <input className='Input' type="password" placeholder='Enter password again' id='SignUpPAssAgain' value={password} onChange={HandlePassword} />
        </label>
         
        <br />
        <input className='checkB' id='male'type='checkbox'/>
        <label className='select-text' >Male&emsp;&emsp;</label>
        <input className='checkB' id='female'type='checkbox'/>
        <label className='select-text' >Female</label>
        <br />

        <label  className='select-text'> Select country:</label>
        <select className='select-box' name="countries" id="contry">
           <option value=" " disabled ></option>
           <option value="Egypt">Egypt</option>
           <option value="Palstine">Palstine</option>
        </select>
        <br />
        <label  className='select-text'> Sign As:</label>
        <select className='select-box' name="character" id="character">
           <option value=" " disabled ></option>
           <option value="Doctor">Doctor</option>
           <option value="Patient">Patient</option>
        </select>
        <br />
        <input type='text' className='Input' id='speciality'placeholder='Enter your speciality ' value={speciality}></input>
        <br />
        <button className='Sign-button' type="submit"><a href='/SignInPage'>Login</a></button>
        <button className='Sign-button' type="submit"><a href='/Home'>Sign Up</a></button>
      </form>
    </div>
  );
};

export default SignUpPage;
